Гулять с ним здорово. Но пришлось внести коррективы:

- планировать прогулки поздно вечером, когда на улице меньше собачников и шума;
- купить другую шлейку;
- не отпускать его на длинный поводок (он однажды лихо заплутал в кустах, распутывались долго);
- брать с собой угощения.

@cats_hurricanes ого))
